import React, { Component } from 'react';

class QuayStatus extends Component {
  constructor(props) {
    super(props);

    this.state = {
      safeToday: true
    }
  }

  status = () => {
    if(this.state.safeToday) {
      return "SAFE"
    } else {
      return "IN DANGER!"
    }
  }

  render() {


    return(
      <p>
        The quay wall is currently {this.status()}
        console.log({this.status()})
      </p>
    );
  }
}

export default QuayStatus;
